import React from "react";

import Navbar from "../components/navbar/Navbar";
import AnimeSidebar from "../components/sidebars/AnimeSidebar";
import DetailsPage from "../components/detailsPage/DetailsPage";
import OwlCarousel from "react-owl-carousel";
import "owl.carousel/dist/assets/owl.carousel.css";
import "owl.carousel/dist/assets/owl.theme.default.css";
const AnimeDetailsPage = () => {
  return (
    // <div className=" anime-container px-0 2xl:px-16">
    //   <div className="container mx-auto">
    //     <Navbar />
    //     <AnimeSidebar />
    //     <div className="px-4">
    //       <DetailsPage />
    //     </div>
    //   </div>
    // </div>
    <OwlCarousel
    className="owl-theme"
    loop
    margin={10}
    nav
    responsive={{
        0: {
            items: 1
        },
        600: {
            items: 3
        },
        1000: {
            items: 5
        }
    }}
>
    <div className="item"><h4>1</h4></div>
    <div className="item"><h4>2</h4></div>
    <div className="item"><h4>3</h4></div>
    <div className="item"><h4>4</h4></div>
    <div className="item"><h4>5</h4></div>
    <div className="item"><h4>6</h4></div>
</OwlCarousel>

  );
};

export default AnimeDetailsPage;
